import { Box, Button, Container, Flex, Image, Text } from "@chakra-ui/react";

function Navbar(){

    return (
        <div>
            <Flex alignItems='center' gap='2' height="70px">
            <Container marginLeft={20}>
                <Flex gap={10} alignItems='center'>
                {/* <Box  boxSize='100px' height="50px" marginTop={-3}> */}
                <Image boxSize='150px' height="90px"  src='https://logos-world.net/wp-content/uploads/2022/04/Harvest-Logo.png' alt='Dan Abramov' />
                {/* </Box> */}
                <Box >
                    <Flex gap={5}>
                            <Text fontSize='1.5rem'>WhyHarvest?</Text>
                            <Text fontSize='1.5rem'>Features</Text>
                            <Text fontSize='1.3rem'>Customes</Text>
                            <Text fontSize='1.3rem'>Integrations</Text>
                            <Text fontSize='1.3rem'>Pricing</Text>
                    </Flex>
                </Box>
                </Flex>
           
            </Container>
            
            <Container marginRight={-20}>
                <Flex>
                    <Text fontSize='1.3rem'>Sign in</Text>
                    <Box>
                    <Button  marginLeft="20px" colorScheme='blue'>Try Harvest free</Button>
                    </Box>
                </Flex>
            </Container>
            </Flex>
        </div>
    )
}

export default Navbar;
